import React from 'react'
import { connect } from 'react-redux'
import { bindActionCreators } from 'redux'

import * as actions from '../../reducer/environment/actions'

type FormProps = {
  query: string,
  setQuery: Function,
}

export class FormNav extends React.Component <FormProps, any>{
  constructor(props: any) {
    super(props)
    this.handleChange = this.handleChange.bind(this)
  }

  public static defaultProps = {
    query: ''
  }

  getQueryString() {
    if (!this.props.query) return ''
  }

  getSliderValue() {
    if (!this.props.query) return 0
  }

  handleChange(event: any) {
    //this.props.setQuery(query);
  }

  render() {
    return (
      <div className="form-nav card">
        <div className="card-content">
          <label htmlFor="time">Time: {`${this.getQueryString()}`}</label>
          <input
            className="time-range-slider"
            id="time"
            type="range"
            min="0"
            max="23.99"
            step="0.02"
            value={this.getSliderValue()}
            onChange={this.handleChange}
          />
        </div>
      </div>
    )
  }
}

const mapStateToProps = ({ environment: { query }}: any) => ({
  query,
})

function mapDispatchToProps(dispatch: any) {
  return {
    setQuery: bindActionCreators(actions.setQuery, dispatch),
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(FormNav)
